CREATE TABLE IF NOT EXISTS `zip_codes` (
  `zip_code` varchar(4) COLLATE utf8_unicode_ci NOT NULL,
  `city` varchar(30) COLLATE utf8_unicode_ci NOT NULL,
  `municipality_code` varchar(3) COLLATE utf8_unicode_ci NOT NULL,
  `municipality_name` varchar(30) COLLATE utf8_unicode_ci NOT NULL,
  `region_code` varchar(4) COLLATE utf8_unicode_ci NOT NULL,
  `region_name` varchar(30) COLLATE utf8_unicode_ci NOT NULL,
  `country_code` varchar(3) COLLATE utf8_unicode_ci NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
